    private void initView() {
        recyclerView.setLayoutManager(new LinearLayoutManager(mContext, RecyclerView.VERTICAL, false));
        DividerItemDecoration decoration = new DividerItemDecoration(mContext, RecyclerView.VERTICAL);
        decoration.setDrawable(mContext.getResources().getDrawable(R.drawable.shape_line));
        recyclerView.addItemDecoration(decoration);
        recyclerView.setAdapter(adapter = new FinanceReportContentAdapter(mContext, beans, widths));
        adapter.bindTitleLinkedHorizontalScrollView(title_hsv);

        mRefreshLoadMoreHelper = new RefreshLoadMoreHelper(mContext);
        adapter.setFootView(mRefreshLoadMoreHelper.getFooterView());
        recyclerView.addOnScrollListener(new RecyclerView.OnScrollListener() {
            @Override
            public void onScrollStateChanged(@NonNull RecyclerView recyclerView, int newState) {
                super.onScrollStateChanged(recyclerView, newState);
                pressed = newState == RecyclerView.SCROLL_STATE_DRAGGING;
                if (mRefreshLoadMoreHelper.hasMore()) {
                    int lastPosition;
                    RecyclerView.LayoutManager layoutManager = recyclerView.getLayoutManager();
                    assert layoutManager != null;
                    lastPosition = ((LinearLayoutManager) layoutManager).findLastCompletelyVisibleItemPosition();
                    if (lastPosition > 1 && lastPosition == recyclerView.getLayoutManager().getItemCount() - 1) {
                        if (newState == RecyclerView.SCROLL_STATE_IDLE) {
                            mRefreshLoadMoreHelper.setFooterViewLoading();
                            initData1();
                        }else if(newState == RecyclerView.SCROLL_STATE_DRAGGING){
                            if(mRefreshLoadMoreHelper.getState() != RefreshLoadMoreHelper.STATE_RELEASE2LOAD)
                                mRefreshLoadMoreHelper.setFooterViewRelease2Load();
                        }
                    }
                }
            }
            private boolean pressed = false;
            public void onScrolled(@NonNull RecyclerView recyclerView, int dx, int dy){
                if (pressed && mRefreshLoadMoreHelper.hasMore()) {
                    int lastPosition;
                    RecyclerView.LayoutManager layoutManager = recyclerView.getLayoutManager();
                    assert layoutManager != null;
                    lastPosition = ((LinearLayoutManager) layoutManager).findLastCompletelyVisibleItemPosition();
                    if (lastPosition > 1 && lastPosition == recyclerView.getLayoutManager().getItemCount() - 1) {
                        if(mRefreshLoadMoreHelper.getState() != RefreshLoadMoreHelper.STATE_RELEASE2LOAD)
                            mRefreshLoadMoreHelper.setFooterViewRelease2Load();
                    }else {
                        if(mRefreshLoadMoreHelper.getState() != RefreshLoadMoreHelper.STATE_PULL2LOAD)
                            mRefreshLoadMoreHelper.setFooterViewPull2Load();
                    }
                }
            }
        });

        LinearLayout.LayoutParams params = (LinearLayout.LayoutParams) table_title.getLayoutParams();
        params.width = (int) (TABLE_NAME_SIZE * density);
        params.gravity = Gravity.CENTER;
        table_title.setLayoutParams(params);

        LinearLayout.LayoutParams params1 = (LinearLayout.LayoutParams) table_title_line.getLayoutParams();
        params1.width = (int) (density + 0.5f);
        table_title_line.setLayoutParams(params1);
    }

    private boolean initTitle = false;
    private void updateFragmentView(FinanceReportData reportData) {
        if(!initTitle) {
            initTitle = true;
            List<String> names = reportData.name_list;
            if (names == null) return;
            int len = names.size();
            int id = R.id.rb1;
            int width = (int) (mContext.getResources().getDisplayMetrics().widthPixels - density * 30);//边距15dp
            if (len == 0) {
                return;
            } else if (len == 1) {
                RadioButton button = getRadioButton(names.get(0));
                button.setBackgroundResource(R.drawable.bg_rb_title_type);
                button.setId(id);
                button.setOnClickListener(this);
                radioGroup.addView(button, new LinearLayout.LayoutParams(width,-1));
            } else {
                int item = width / len - ((int) (density + 0.5f) * len - 1);
                LinearLayout.LayoutParams params = new LinearLayout.LayoutParams(item,-1);
                RadioButton button = getRadioButton(names.get(0));
                button.setBackgroundResource(R.drawable.bg_rb_title_type_left);
                button.setId(id);
                button.setOnClickListener(this);
                radioGroup.addView(button, params);
                View vLine = getVLine();
                vLine.setBackgroundColor(getResources().getColor(R.color.color_ff4987f1));
                radioGroup.addView(vLine);
                for (int i = 1; i < len - 1; i++) {
                    RadioButton button1 = getRadioButton(names.get(i));
                    button1.setBackgroundResource(R.drawable.bg_rb_title_type_center);
                    button1.setId(id + i);
                    button1.setOnClickListener(this);
                    radioGroup.addView(button1, params);
                    View line = getVLine();
                    line.setBackgroundColor(getResources().getColor(R.color.color_ff4987f1));
                    radioGroup.addView(line);
                }
                RadioButton button1 = getRadioButton(names.get(len - 1));
                button1.setBackgroundResource(R.drawable.bg_rb_title_type_right);
                button1.setId(id + len - 1);
                button1.setOnClickListener(this);
                radioGroup.addView(button1, new LinearLayout.LayoutParams(-1,-1));
            }

            target_name = reportData.target_name;
        }

        List<FinanceReportData.ListBean> beans = reportData.list;
        if (beans == null) {
            mRefreshLoadMoreHelper.setFooterViewHasNoMoreData();
            return;
        }
        if (beans.size() < 10) {
            mRefreshLoadMoreHelper.setFooterViewHasNoMoreData();
        }else {
            mRefreshLoadMoreHelper.setFooterViewPull2Load();
        }
        this.beans.addAll(beans);
        RadioButton child = (RadioButton) radioGroup.getChildAt(index*2);
        radioGroup.clearCheck();
        child.performClick();
    }
    @Override
    public void onClick(View view) {
        if(view instanceof RadioButton){
            clickTitle((RadioButton)view);
        }
    }

    private int index = 0;
    public List<TextView> text_view = new ArrayList<>();
    private List<Integer> widths = new ArrayList<>();
    private LinearLayout.LayoutParams vParams;
    private List<List<String>> target_name;
    private void clickTitle(RadioButton rb) {
        index = rb.getId() - R.id.rb1;
        if(index < 0 || index >= target_name.size()) return;
        List<String> strings = target_name.get(index);
        int old_size = text_view.size();
        int size = strings.size();
        int count = 0;
        widths.clear();
        if(old_size < size) {
            for (int i = 0; i < old_size; i++) {
                String title = strings.get(i);
                int width = FinanceReportContentAdapter.getWidth(title, density);
                count += width;
                widths.add(width);
                if (i > 0) {
                    count += (int) (density + 0.5f);
                }
                TextView textView = text_view.get(i);
                ViewGroup.LayoutParams params = textView.getLayoutParams();
                params.width = width;
                textView.setLayoutParams(params);
                textView.setText(title);
            }
            for (int i = old_size; i < size; i++) {
                String title = strings.get(i);
                int width = FinanceReportContentAdapter.getWidth(title, density);
                count += width;
                widths.add(width);
                LinearLayout.LayoutParams param_title = new LinearLayout.LayoutParams(width, (int) (34 * density));
                param_title.gravity = Gravity.CENTER;
                TextView textView = getTextView(title);
                if (i != 0) {
                    count += (int) (density + 0.5f);
                    title_hsv.addView(getVLine());
                }
                title_hsv.addView(textView, param_title);
                text_view.add(textView);
            }
        }else {
            for (int i = 0; i < size; i++) {
                String title = strings.get(i);
                int width = FinanceReportContentAdapter.getWidth(title, density);
                count += width;
                widths.add(width);
                if (i > 0) {
                    count += (int) (density + 0.5f);
                }
                TextView textView = text_view.get(i);
                ViewGroup.LayoutParams params = textView.getLayoutParams();
                params.width = width;
                textView.setLayoutParams(params);
                textView.setText(title);
            }
            for (int i = old_size; i < size; i++) {
                TextView textView = text_view.get(i);
                ViewGroup.LayoutParams params = textView.getLayoutParams();
                params.width = 0;
                textView.setLayoutParams(params);
            }
        }
        count = (int) (count - mContext.getResources().getDisplayMetrics().widthPixels + TABLE_NAME_SIZE * density);
        title_hsv.setWidth(count);
        adapter.setIndex(index);
    }
    private View getVLine() {
        View line = new View(mContext);
        line.setLayoutParams(vParams);
        line.setBackgroundColor(getResources().getColor(R.color.list_divider_color));
        return line;
    }

    private TextView getTextView(String text) {
        TextView tv = new TextView(mContext);
        tv.setGravity(Gravity.CENTER);
        tv.setTextSize(TABLE_TITLE_TEXT_SIZE);
        tv.setText(text);
        tv.setTextColor(getResources().getColor(R.color.color_949799));
        return tv;
    }

    private RadioButton getRadioButton(String text) {
        RadioButton rb = (RadioButton) View.inflate(mContext, R.layout.radio_button, null);
        rb.setText(text);
        return rb;
    }

